use std::time::Instant;
use rand::Rng;


fn vecswap(mut i: i32, mut j: i32, mut n:i32, x: &mut [&str]) {
	
    while n > 0 {
		// swap position of i and j
        let t: &str = x[i as usize];
	   	x[i as usize] = x[j as usize];	
	   	x[j as usize] = t;

        i = i + 1;
        j = j + 1;

	   	n = n - 1;
	}
}

fn ssort1(x: &mut [&str], n: i32, depth: usize) {


    // DEBUG
    // print!("[");
    for i in 0..n {
        if i == n-1 {
            // print!("{:?}", x[i as usize]);
            break;
        }
        // print!("{:?}, ", x[i as usize]);
    }
    // println!("]");

    // println!("n={:?}", n);
    // println!("depth={:?}", depth);
   
    

    let mut a: i32;
    let mut b: i32;
    let mut c: i32;
    let mut d: i32;
    let mut r: i32 = 0;
    let v: i32;
    
    if n <= 1 {
        // println!("return\n");
        return;
    }

    // generate random number from 0 - max_int
    let mut rng = rand::thread_rng();
    a = rng.gen_range(0..i32::MAX) % n;
    // a = 0;

    // use random number to choose random str from array
    // swap this str to the beginning of the array
   	let t: &str = x[0];
   	x[0] = x[a as usize];
   	x[a as usize] = t;


   	// get the ascii value of the character at index "depth" of the 0th string of the array
   	// equivalent to "i2c(0)" in C
    if depth < x[0].len() {
        v = x[0].chars().nth(depth).unwrap() as i32; 
    } else {
        v = 0;
    }
   	

   	a = 1;
   	b = 1;
    c = n - 1; 
    d = n - 1; 

   	loop 
   	{
   		// get the ascii value of the character at index "depth" of the bth string of the array
        // checking b <= c insures index is within array bounds
        // equivalent to "i2c(b)" in C
        if b <= c {
            if depth < x[b as usize].len(){
                r = (x[b as usize].chars().nth(depth).unwrap() as i32) - v;
            } else {
                r = 0 - v;
            }
        } 
   		while b <= c && r <= 0 {
            if r == 0 {
            	// swap position of a and b
                // println!("Swapping a and b");
                let t: &str = x[a as usize];
			   	x[a as usize] = x[b as usize];
			   	x[b as usize] = t;

                a = a + 1;
            }
            b = b + 1;
            
            // get the ascii value of the character at index "depth" of the bth string of the array
            // checking b <= c insures index is within array bounds
            // equivalent to "i2c(b)" in C
            if b <= c {
                if depth < x[b as usize].len(){
                    r = (x[b as usize].chars().nth(depth).unwrap() as i32) - v;
                } else {
                    r = 0 - v;
                }
            } 
        }



        // get the ascii value of the character at index "depth" of the bth string of the array
        // c <= n - 1, so it is safe to index array
        // equivalent to "i2c(c)" in C
        if depth < x[c as usize].len(){
            r = (x[c as usize].chars().nth(depth).unwrap() as i32) - v;
        } else {
            r = 0 - v;
        }
        // println!("OUTSIDE");
        while b <= c && r >= 0 {
            
            // println!("INSIDE");
            // println!("r={}", r);
            if r == 0 {
                // swap position of c and d
                // println!("Swapping c and d");
                let t: &str = x[c as usize];
			   	x[c as usize] = x[d as usize];
			   	x[d as usize] = t;

                d = d - 1;
            }

            c = c - 1;

            // get the ascii value of the character at index "depth" of the bth string of the array
            // c <= n - 1, so it is safe to index array
            // equivalent to "i2c(c)" in C
            if b <= c {
                if depth < x[c as usize].len(){
                    r = (x[c as usize].chars().nth(depth).unwrap() as i32) - v;
                } else {
                    r = 0 - v;
                }   
            }                         
        }

        if b > c {
            // println!("b={} > c={}",b,c);
            break;
        }

        // swap position of b and c
        // println!("Swapping b and c");
        let t: &str = x[b as usize];
	   	x[b as usize] = x[c as usize];
	   	x[c as usize] = t;

        b = b + 1;
       	c = c - 1;
    }

    // r = min(a, b - a);
    if a <= b - a {
    	r = a;
    } else {
    	r = b - a;
    }

    vecswap(0, b - r, r, x);

    // r = min(d - c, n - d - 1);
    if (d - c) <= (n - d - 1) {
    	r = d - c;
    } else {
    	r = n - d - 1;
    }

    vecswap(b, n - r, r, x);
    
    r = b - a;


    // println!("Calling ssort with n=r={}\n", r);
    ssort1(x, r, depth);
    
    if depth < x[r as usize].len() {
        // i2c(r) != 0
        let ru = r as usize;
        // println!("Calling ssort with n=a+n-d-1={}", a + n - d - 1);
        // println!("a={}, n={}, d={}\n", a, n, d);
        ssort1(&mut x[ru..], a + n - d - 1, depth + 1);
    } 

    r = d - c;

    // ssort1(x + n - r, r, depth);
    let ru = r as usize;
    let nu = n as usize;
    // println!("Calling ssort with n=r={}\n", r);
    ssort1(&mut x[nu-ru..], r, depth);
}






